import React, { Component } from "react";
import Particles from "react-particles-js";

const particleOpt = {
  particles: {
    number: {
      value: 150,
      density: {
        enable: true,
        value_area: 2000
      }
    }
  }
};

class Header extends Component {
  render() {
    return (
      <div className="header">
        <Particles params={particleOpt} />
      </div>
    );
  }
}

export default Header;
